import React, { useEffect, useState } from "react";
import '../css/styles.css';
import imageBackArrow from '../css/assets/back-arrow.png';
import imageEllipse from '../css/assets/switch.png';
// import Collapsible from "../components/CollapsibleStation";
import imageMinus from '../css/assets/minus.png';
import imagePlus from '../css/assets/plus.png';
import StationProvider, { StationContext } from './StationContext'
import { useContext } from "react";
import IStation from "../interfaces/Station";

const StationCards = () => {

  const { sortedStations } = useContext(StationContext);
  const { displayStation } = useContext(StationContext);
  const [isOpen, setIsOpen] = useState(Boolean);
  const [displayChild, setDisplayChild] = useState(displayStation);

  const handleFilterOpening = (id: number) => {
    console.log("id" + id);
    let pushInc: number = 0;
    const display: any[] = [];

    while (pushInc < displayStation.length) {
      display.push(pushInc);
      pushInc++;
    }
    setDisplayChild(display);

    setIsOpen((prev) => !prev);

    if (!isOpen) {
      console.log("index");
      for (let item of displayChild) {
        if (item == id) {
          console.log("item" + item);
          let index = displayChild.indexOf(item);
          if (index !== -1) {
            console.log("index--" + index);
            displayChild[index] = <table className="cover-bttom" >
              <tr>
                <td>
                  <img src={imageMinus} width="64px" height="64px" />
                </td>
                <td>
                  <span className="pad-col-span">

                  </span>
                </td>

                <td>
                  <svg
                    xmlns="http://www.w3.org/2000/svg"
                    xmlnsXlink="http://www.w3.org/1999/xlink"
                    width="280px" height="280px">
                    <image x="0px" y="0px" width="280px" height="280px" xlinkHref="data:img/png;base64," />
                  </svg>

                </td>
                <td></td>
                <span className="pad-col-span">

                </span>
                <td>
                  <img src={imagePlus} width="64px" height="64px" />
                </td>
              </tr>
            </table>

          }
        }
      }

      setDisplayChild(displayChild);
    }

  };

  useEffect(() => {
    if (isOpen) setIsOpen(false);
  }, []);


  return (
    <>
      <div className="card">
        <div className="card-header">
          <span className="arrow-left">
            <img src={imageBackArrow} width="40px" height="48px" />
          </span>
          <span className="stations-text">
            STATIONS
          </span>
          <span className="ellipse">
            <img src={imageEllipse} width="40px" height="48px" />
          </span>
        </div>
        <div className="putin-fm">
          <table>
            <tbody>
              {sortedStations.map(station =>
                <tr className="row-align">
                  <button type="button" onClick={() => handleFilterOpening(sortedStations.indexOf(station))} className="button-fm">
                    <table >
                      <tr >
                        <td>{station.stationName}</td>
                        {/* <span className="pad-col"></span> */}
                        <td className="pad-col">

                        </td>
                        <td >{station.stationBand}</td>
                      </tr>
                      <tr>
                        <td className="rectangle"> </td>
                      </tr>
                    </table>

                  </button>
                  <div >
                    <div>{isOpen && displayChild[sortedStations.indexOf(station)]}</div></div>
                </tr>)}
            </tbody>
          </table>
        </div>
        <div className="footer-1">
          <footer>CURRENTLY PLAYING</footer>
        </div>
        <div className="footer-2">
          <footer>Dribbble FM</footer>
        </div>
      </div>
    </>
  );
};

export default () => (
  <StationProvider>
    <StationCards />
  </StationProvider>
);